import React from "react";

const HeritageProjects = () => {
  return (
    <div className="p-6">
      <h1 className="text-3xl font-bold text-gray-800 amiri-font mb-6">
        مشاريع التراث
      </h1>
      <p className="text-gray-600">صفحة مشاريع التراث قيد التطوير...</p>
    </div>
  );
};

export default HeritageProjects;
